import React from 'react';
import ReactDOM from 'react-dom';

import { Route, BrowserRouter as Router } from 'react-router-dom'

import ExchangeInterface from './exchange_interface.js';
import TraderInterface from './trader_interface.jsx';
import Login from './login_page.js';
import './index.css';

/*class Root extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            websocket: null
        }
    }
}*/


class Main extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            exchange_host: "ws://le-chateaud:6789/"
        }
    }

    connect(){
        this.exchange_interface.connect()
    }

    render() {
        return (
			<div className="main">
              <div className="main-trader-interface">
                <ExchangeInterface ref={exchange_interface => {
                  this.exchange_interface = exchange_interface;}}/>
                <TraderInterface connect={this.connect} />
			  </div>
			</div>
	    );
    }
}

// ========================================

const routing = (
  <Router>
    <div>
      <Route exact path="/" component={Login} />
      <Route path="/TraderInterface" component={Main} />
    </div>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root'))
